import logo from './logo.svg';
import './App.css';
import axios from 'axios';
import Router from './router/Router';

async function App() {
  const data = {
    email: 'prueba@gmail.com',
    password: 1234567,
  };
  const res = await axios.post(
    `${process.env.REACT_APP_API_URL}/api/v1/users/login`,
    data
  );

  console.log(res.data);

  return <Router />;
}

export default App;
